    }
    function handleChange(e) {
        
    }
    return (
        <form id="formLogin" className={classes.form} noValidate onSubmit={handleSubmit}>
            <TextField
                variant="outlined"
                margin="normal"
                required
                fullWidth
                id="currentPass"
                label="Mật khẩu hiện tại"
                name="currentPass"
                type="password"
                autoComplete="currentPass"
                autoFocus
                onChange={handleChange}
            />
            <TextField
                variant="outlined"
                margin="normal"
                required
                fullWidth
                name="newPass"
                label="Mật khẩu mới"
                type="password"
                id="newPass"
                autoComplete="newPass"
                onChange={handleChange}
            />
            <TextField
                variant="outlined"
                margin="normal"
                required
                fullWidth
                name="confirmPass"
                label="Nhập lại mật khẩu mới"
                type="password"
                id="confirmPass"
                autoComplete="confirmPass"
                onChange={handleChange}
            />
            <Button
                type="submit"
                form="formLogin"
                fullWidth
                variant="contained"
                color="primary"
                className={classes.submit}
            >
                Thay đổi
    </Button>
        </form>
    );
}
